# 这里定义了后端各个参数的值
def get_args(purpose,post_args, img_path):
    args = mae_args()
    args.purpose = purpose;
    args.img_path = img_path;
    args.pwd = post_args.pwd;
    args.appendant = post_args.appendant;
    args.checkpwd = post_args.checkpwd;
    args.username = post_args.username
