# 将各个参数传入到模型中，获得一个model
def get_model(args):
    print(f"Creating model: {args.model}")
    model = create_model(
        args.model,
        pretrained=False,
        drop_path_rate=args.drop_path,
        drop_block_rate=None,
    )

    return model


# 获取图像，如果是encoding（加密）操作，将传入的base64变为图像，并返回路径；若是decoding
# 操作，返回数据库中的图像块路径
def get_img_path(purpose, base64_str):
    if purpose == "e" or purpose == "test":
        base64_str = base64_str.split('base64,')[1]  # 删去头
        im2 = base64.b64decode(base64_str)  # <class "bytes">
        nparr = np.frombuffer(im2, np.uint8)  # <class "numpy.ndarray">
        img_decode = cv2.imdecode(nparr, 1)  # <class "numpy.ndarray">
        cv2.imwrite("output/ori_img.jpg", img_decode)
        return "output/ori_img.jpg"
    elif purpose == "d":
        return "output/encoding/mask_img.jpg"


# 这是一个总流程，即编码+解码,用于判断用户的密码是否足够好
def test(args):
    print(args)
    device = torch.device(args.device)
    cudnn.benchmark = True

    model = get_model(args)
    patch_size = model.encoder.patch_embed.patch_size
    print("Patch size = %s" % str(patch_size))
    args.window_size = (args.input_size // patch_size[0], args.input_size // patch_size[1])
    args.patch_size = patch_size

    model.to(device)
    checkpoint = torch.load(args.model_path, map_location="cpu")
    model.load_state_dict(checkpoint["model"])
    model.eval()
    # img_path: "/files/ori_img.jpg"
    with open(args.img_path, "rb") as f:
        img = Image.open(f)
        img.convert("RGB")
        print("img path:", args.img_path)

    transforms = DataAugmentationForMAE(args)
    img, bool_masked_pos = transforms(img)
    bool_masked_pos = torch.from_numpy(bool_masked_pos)

    with torch.no_grad():
        img = img[None, :]
        bool_masked_pos = bool_masked_pos[None, :]
        img = img.to(device, non_blocking=True)
        bool_masked_pos = bool_masked_pos.to(device, non_blocking=True).flatten(1).to(torch.bool)
        outputs = model(img, bool_masked_pos)

        # save original img
        mean = torch.as_tensor(IMAGENET_DEFAULT_MEAN).to(device)[None, :, None, None]
        std = torch.as_tensor(IMAGENET_DEFAULT_STD).to(device)[None, :, None, None]
        ori_img = img * std + mean  # in [0, 1]
        img = ToPILImage()(ori_img[0, :])
        img.save(f"{args.save_path}/ori_img.jpg")

        img_squeeze = rearrange(ori_img, "b c (h p1) (w p2) -> b (h w) (p1 p2) c", p1=patch_size[0], p2=patch_size[0])

        img_norm = (img_squeeze - img_squeeze.mean(dim=-2, keepdim=True)) / (
                img_squeeze.var(dim=-2, unbiased=True, keepdim=True).sqrt() + 1e-6)
        img_patch = rearrange(img_norm, "b n p c -> b n (p c)")
        img_patch[bool_masked_pos] = outputs

        # make mask
        mask = torch.ones_like(img_patch)
        mask[bool_masked_pos] = 0
        mask = rearrange(mask, "b n (p c) -> b n p c", c=3)
        mask = rearrange(mask, "b (h w) (p1 p2) c -> b c (h p1) (w p2)", p1=patch_size[0], p2=patch_size[1], h=14, w=14)

        # save reconstruction img
        rec_img = rearrange(img_patch, "b n (p c) -> b n p c", c=3)
        rec_img = rec_img * (img_squeeze.var(dim=-2, unbiased=True, keepdim=True).sqrt() + 1e-6) + img_squeeze.mean(
            dim=-2, keepdim=True)
        rec_img = rearrange(rec_img, "b (h w) (p1 p2) c -> b c (h p1) (w p2)", p1=patch_size[0], p2=patch_size[1], h=14,
                            w=14)
        img = ToPILImage()(rec_img[0, :].clip(0, 0.996))
        img.save(f"{args.save_path}/rec_img.jpg")
        # save random mask img
        img_mask = rec_img * mask
        img = ToPILImage()(img_mask[0, :])
        img.save(f"{args.save_path}/mask_img.jpg")


# 加密操作，先给图像加mask并存储，随后将224*224的mask图像变为只含有相对位置信息的图像块（一排）
def encoding(args):
    """
        将files/ori_img按照pwd + appendant进行加密，原图存储至/encoding/ori_img，获得mask_img与mask_img_to_client
    """
    print(args)
    model = get_model(args)
    patch_size = model.encoder.patch_embed.patch_size
    print("Patch size = %s" % str(patch_size))
    # 14*14的windows_size
    args.window_size = (args.input_size // patch_size[0], args.input_size // patch_size[1])
    print("window size = %s" % str(args.window_size))
    # 下面获取图像并裁剪，获取mask矩阵
    with open(args.img_path, "rb") as f:
        img = Image.open(f)
        img.convert("RGB")
        print("img path:", args.img_path)
    transforms = DataAugmentationForMAE(args)
    img, mask_np = transforms(img)
    bool_masked_pos = torch.from_numpy(mask_np)
    with torch.no_grad():
        img = img[None, :]
        bool_masked_pos = bool_masked_pos[None, :]
        img = img.to(device, non_blocking=True)
        bool_masked_pos = bool_masked_pos.to(device, non_blocking=True).flatten(1).to(torch.bool)

        # save original img
        mean = torch.as_tensor(IMAGENET_DEFAULT_MEAN).to(device)[None, :, None, None]
        std = torch.as_tensor(IMAGENET_DEFAULT_STD).to(device)[None, :, None, None]
        ori_img = img * std + mean  # in [0, 1]
        img = ToPILImage()(ori_img[0, :])
        img.save(f"{args.save_path}/encoding/ori_img.jpg")

        img_squeeze = rearrange(ori_img, "b c (h p1) (w p2) -> b (h w) (p1 p2) c", p1=patch_size[0], p2=patch_size[0])
        img_norm = (img_squeeze - img_squeeze.mean(dim=-2, keepdim=True)) / (
                img_squeeze.var(dim=-2, unbiased=True, keepdim=True).sqrt() + 1e-6)
        img_patch = rearrange(img_norm, "b n p c -> b n (p c)")
        # 存储均值和方差，三维矩阵
        mean, var = [img_squeeze.mean(dim=-2, keepdim=True), img_squeeze.var(dim=-2, unbiased=True, keepdim=True)]
        torch.save([mean, var], f"{args.save_path}/meanvar.pth")

        # make mask
        mask = torch.ones_like(img_patch)
        mask[bool_masked_pos] = 0  # 黑块
        # print(mask)
        mask = rearrange(mask, "b n (p c) -> b n p c", c=3)
        mask = rearrange(mask, "b (h w) (p1 p2) c -> b c (h p1) (w p2)", p1=patch_size[0], p2=patch_size[1], h=14, w=14)
        # print(mask.shape)
        # save random mask img
        img_mask = ori_img * mask
        img = ToPILImage()(img_mask[0, :])
        img_np = np.asarray(img)

        size_h, size_w = patch_size  # 16
        patch_h = int(args.input_size / size_h);  # 14
        patch_w = int(args.input_size / size_w);
        patch_num = int(patch_h * patch_w);
        # 下面把224*224的mask图像，变为只有相对信息的图像块（一排）
        save_img = np.zeros([size_h, int(size_w * patch_num * (1 - args.mask_ratio)), 3])
        save_num = -1;
        for i in range(0, patch_num):
            if mask_np[i] == 0:
                i = i + 1;
                save_num += 1;
                for j in range(0, size_h):
                    for k in range(0, size_w):
                        h = int((i / patch_w)) * size_h + j;
                        w = int(((i - 1) % patch_w)) * size_w + k
                        if int(((i - 1) % patch_w)) == 13:
                            h -= size_h;
                        save_w = int(k + save_num * size_w)
                        save_img[j, save_w, :] = img_np[h, w, :];
        img_maskpatch = Image.fromarray(np.uint8(save_img))
        img.save(f"{args.save_path}/encoding/mask_img_to_client.jpg")
        img_maskpatch.save(f"{args.save_path}/encoding/mask_img.jpg")


# 解密操作，先将只含有相对位置信息的图像块（一排）根据mask密钥变成224*224的图像输入到模型中，模型返回一个结果
def decoding(args):
    """
        decryption: 将encoding/mask_img（数据库存储）图像还原为/decoding/mask_img（客户端展示），输入模型将输出保存至decoding/rec_img
    """
    print(args)

    device = torch.device(args.device)
    cudnn.benchmark = True

    model = get_model(args)
    patch_size = model.encoder.patch_embed.patch_size
    print("Patch size = %s" % str(patch_size))
    args.window_size = (args.input_size // patch_size[0], args.input_size // patch_size[1])
    args.patch_size = patch_size

    model.to(device)
    checkpoint = torch.load(args.model_path, map_location="cpu")
    model.load_state_dict(checkpoint["model"])
    model.eval()
    # output/encoding/mask_img
    with open(args.img_path, "rb") as f:
        img = Image.open(f)
        img.convert("RGB")
        print("img path:", args.img_path)
    transforms = DataAugmentationForMAE(args)
    _, mask_np = transforms(img)
    # 处理图像
    img_np = np.asarray(img)
    size_h, size_w = patch_size  # 16
    patch_h = int(args.input_size / size_h);  # 14
    patch_w = int(args.input_size / size_w);
    patch_num = int(patch_h * patch_w);
    mask_img = np.zeros([int(size_h * patch_h), int(size_w * patch_w), 3])
    check_num = -1;
    # 下面处理将图像块组合出224*224规格，mask部分用黑色填充
    for i in range(0, patch_num):
        if mask_np[i] == 0:
            i = i + 1;
            check_num += 1;
            for j in range(0, size_h):
                for k in range(0, size_w):
                    h = int((i / patch_w)) * size_h + j;
                    w = int(((i - 1) % patch_w)) * size_w + k
                    if int(((i - 1) % patch_w)) == 13:
                        h -= size_h;
                    check_w = int(k + check_num * size_w)
                    mask_img[h, w, :] = img_np[j, check_w, :];
    img = Image.fromarray(np.uint8(mask_img))
    img.save(f"{args.save_path}/decoding/mask_img.jpg")

    img, mask_np = transforms(img)
    bool_masked_pos = torch.from_numpy(mask_np)
    with torch.no_grad():
        img = img[None, :]
        bool_masked_pos = bool_masked_pos[None, :]
        img = img.to(device, non_blocking=True)
        bool_masked_pos = bool_masked_pos.to(device, non_blocking=True).flatten(1).to(torch.bool)
        outputs = model(img, bool_masked_pos)
        # #save original img
        mean = torch.as_tensor(IMAGENET_DEFAULT_MEAN).to(device)[None, :, None, None]
        std = torch.as_tensor(IMAGENET_DEFAULT_STD).to(device)[None, :, None, None]
        ori_img = img * std + mean  # in [0, 1]
        img_squeeze = rearrange(ori_img, "b c (h p1) (w p2) -> b (h w) (p1 p2) c", p1=patch_size[0], p2=patch_size[0])

        if os.path.exists(f"{args.save_path}/meanvar.pth"):
            mean, var = torch.load(f"{args.save_path}/meanvar.pth")
        else:
            print("not exists meanvar.pth")
            return 0;
        img_norm = (img_squeeze - mean) / (var.sqrt() + 1e-6)
        img_patch = rearrange(img_norm, "b n p c -> b n (p c)")
        img_patch[bool_masked_pos] = outputs  # 在被mask的地方填入输出
        # save reconstruction img
        rec_img = rearrange(img_patch, "b n (p c) -> b n p c", c=3)
        rec_img = rec_img * (var.sqrt() + 1e-6) + mean
        rec_img = rearrange(rec_img, "b (h w) (p1 p2) c -> b c (h p1) (w p2)", p1=patch_size[0], p2=patch_size[1], h=14,
                            w=14)
        img = ToPILImage()(rec_img[0, :].clip(0, 0.996))
        img.save(f"{args.save_path}/decoding/rec_img.jpg")


