@app.post("/test")
def calculate(item: Item,db: Session = Depends(get_db)):
    """
        @params:    img_base64: 用户人脸, default = "data:xxx"，见上mae_args类, 必选
                    checkpwd: 用户是否需要密码, default = true, 不选，默认值即可
                    pwd: 用户密码, default = "", 必选
                    appendant: seed偏移量， default = 28, 必选
        @return:    JSON
                    {"success": True, "rec_img": "data:image/jpg;base64," + rec_img, "appendant": opts.appendant, "checkpwd": opts.checkpwd,"score":result_baidu['result']['score']}
        可在output/mask_img查看遮罩图，rec_img and ori_img
    """
    user_exist = db.query(models.User).filter(models.User.username == item.username).first()
    if(user_exist!=None):
         return {"success": False, "err_msg": "have existed username","err_code":2,"code":20000}

    purpose = "test"
    img_path = get_img_path(purpose, item.img_base64)
    count=0;
    while True:
        opts = get_args(purpose,item, img_path)
        test(opts)
        im = cv2.imread(f"{opts.save_path}/rec_img.jpg")
        img_encode = cv2.imencode(".jpg", im)[1]
        data_encode = np.array(img_encode)
        img_b64 = data_encode.tobytes()
        rec_img = base64.b64encode(img_b64).decode("utf-8")
        result_baidu = client.match([
                                        {
                                            "image": rec_img,
                                            "image_type": "BASE64",
                                            "face_type": "LIVE",
                                            "liveness_control": "NONE"
                                        },
                                        {
                                            "image": item.img_base64.split('base64,')[1],
                                            "image_type": "BASE64",
                                            "face_type": "LIVE",
                                            "liveness_control": "NONE"
                                        }
                                    ])
        print(result_baidu['error_msg'])
        if(result_baidu['result']['score']>90):
            break;
        elif count>10:
            return {"success": False, "err_msg": "the face is not so good","code":20000}
            break;
        else:
            print("当前附加值为",item.appendant) 
            print("测试得分为",result_baidu['result']['score']) 
            item.appendant+=1;
            count+=1;
    print("测试得分为",result_baidu['result']['score'])       
    print("相应附加值为",item.appendant)
    return {"success": True, "rec_img": "data:image/jpg;base64," + rec_img, "appendant": opts.appendant, "checkpwd": opts.checkpwd,"score":result_baidu['result']['score'],"code":20000}

