        img_encode = cv2.imencode(".jpg", im)[1]
        data_encode = np.array(img_encode)
        img_b64 = data_encode.tobytes()  # bytes流
        patch_img = base64.b64encode(img_b64).decode("utf-8")
        im = cv2.imread(f"{opts.save_path}/encoding/mask_img_to_client.jpg")
        img_encode = cv2.imencode(".jpg", im)[1]
        data_encode = np.array(img_encode)
        img_b64 = data_encode.tobytes()
        mask_img = base64.b64encode(img_b64).decode("utf-8")
        torch.save([opts.appendant, opts.checkpwd], f"{opts.save_path}/appendant&checkpwd.pth")
        face = "data:image/jpg;base64," + patch_img

        # 将加密图像/encoding/mask_img存入数据库
        user = models.User()
        user.username = opts.username
        user.face = face
        user.appendant = opts.appendant
        with open(f"{opts.save_path}/meanvar.pth", "rb") as f:
            bytes = f.read()
            user.meanVar = bytes
        db.add(user)
        db.commit()
        db.refresh(user)

        return {"success": True, "patch_img": "data:image/jpg;base64," + patch_img,
                "mask_img": "data:image/jpg;base64," + mask_img, "appendant": opts.appendant, "checkpwd": opts.checkpwd,"code":20000}


