@app.post("/rec")
def rec(item: Item, db: Session = Depends(get_db)):
    """
        @params: username:"alice"; pwd:"asdf"(if checkpwd == true)
        @return: JSON {"success": True, "rec_img": "data:image/jpg;base64," + rec_img}
        rec_img 为复原后图像的base64
    """
    purpose = "d"
    img_path = get_img_path(purpose, item.img_base64)
    opts = get_args(purpose,item, img_path)
    # 获取用户appendant和checkpwd
    user = db.query(models.User).filter(models.User.username == item.username).first()
    if(user!=None):
        opts.appendant = user.appendant
        # opts.checkpwd = True if user.checkpwd == 1 else False
        # 将数据库中对应user的face写到img_path下
        face = user.face
        face = face.split(';base64,')[1]
        # print(face)
        # base64 -> jpg     /encoding/mask_img
        data = base64.b64decode(face)
        with open("output/encoding/mask_img.jpg", "wb") as f:
            f.write(data)
        # 在数据库中找var和mean，写成pth文件
        user = db.query(models.User).filter(models.User.username == opts.username).first()
        bytes = user.meanVar
        with open(f"{opts.save_path}/meanvar.pth", "wb") as f:
            f.write(bytes)
        decoding(opts)
        im = cv2.imread(f"{opts.save_path}/decoding/rec_img.jpg")
        img_encode = cv2.imencode(".jpg", im)[1]
        data_encode = np.array(img_encode)
        img_b64 = data_encode.tobytes()
        rec_img = base64.b64encode(img_b64).decode("utf-8")
        return {"success": True, "rec_img": "data:image/jpg;base64," + rec_img,"code":20000}
    else:
        return {"success": False, "err_msg": "not exists username","err_code":1,"code":20000}

