@app.post("/detect")
def calculate(item: baidudetect):
    """
        @params:    img_base64: 带有用户人脸的图, default = "data:xxx"，见上mae_args类, 必选
                    mask:是否考虑戴口罩的情况，default=Ture
                  
      @ return JSON{"success": True, "angle":result_baidu['result']['face_list'][0]['angle'],
      "blur":result_baidu['result']['face_list'][0]['quality']['blur'],
      "mask":result_baidu['result']['face_list'][0]['mask']['type'],
      "completeness":result_baidu['result']['face_list'][0]['quality']['completeness'],
      'face_img':img64,"pwd":str(pwd),"code":20000}
    """
    base64_str = item.img_base64.split('base64,')[1]  # 删去头
    im2 = base64.b64decode(base64_str)  # <class "bytes">
    img_decode = np.frombuffer(im2, np.uint8)  # <class "numpy.ndarray">
    img_decode = cv2.imdecode(img_decode, 1)  # <class "numpy.ndarray"> 
    # print(img_decode.shape)
    k=min(1000/img_decode.shape[0],1000/img_decode.shape[1])
    img_decode=cv2.resize(img_decode,(0,0),fx=k,fy=k,interpolation=cv2.INTER_NEAREST)
    img_encode = cv2.imencode(".jpg", img_decode)[1]
    data_encode = np.array(img_encode)
    img_b64 = data_encode.tobytes()
    crop_img = base64.b64encode(img_b64).decode("utf-8")
    options = {}
    options["face_field"] = "race,mask,face_shape,gender,quality"
    result_baidu = client.detect(crop_img, "BASE64",options);
    if(result_baidu['error_code']==222202):
        return {"success": False, "err_msg":result_baidu['error_msg'],"code":20000}

    #开始实验测试点
    pwd=1;
    a=result_baidu['result']['face_list'][0]['race']
    if(item.mask==False):
        b=result_baidu['result']['face_list'][0]['face_shape']['type']
    else:
        b='mask_unknown'
    c=result_baidu['result']['face_list'][0]['gender']
    pwd=str(a['type'])+"_"+str(b)+"_"+str(c['type'])
    top=result_baidu['result']['face_list'][0]['location']['top']
    height=result_baidu['result']['face_list'][0]['location']['height']
    left=result_baidu['result']['face_list'][0]['location']['left']
    width=result_baidu['result']['face_list'][0]['location']['width']
    longth=max(height,width)
    print([top,height,left,width])
    # print(height/width)
    l=int(img_decode.shape[0]/10)
    a=max(int(top)-l,0)
    b=min(int(top)+int(longth),img_decode.shape[0])
    c=max(int(left)-int(l/2),0)
    d=min((b-a)+c,img_decode.shape[1])
    cropped = img_decode[a:b, c:d]  # 裁剪坐标为[y0:y1, x0:x1]
    e=min(cropped.shape[0],cropped.shape[1])
    cropped=cropped[0:e,0:e]
    img_encode = cv2.imencode(".jpg", cropped)[1]
    data_encode = np.array(img_encode)
    img_b64 = data_encode.tobytes()
    img64 = "data:image/jpg;base64,"+base64.b64encode(img_b64).decode("utf-8")
    cv2.imwrite("output/cropped_img.jpg", cropped)
    print("mask_status: "+str(result_baidu['result']['face_list'][0]['mask']['type']))
    if(result_baidu.__contains__('error_code') and result_baidu['error_code']!=0):
        return {"success": False, "err_msg":result_baidu['error_msg'],"code":20000}
    else:
        return {"success": True, "angle":result_baidu['result']['face_list'][0]['angle'],"blur":result_baidu['result']['face_list'][0]['quality']['blur'],"mask":result_baidu['result']['face_list'][0]['mask']['type'],"completeness":result_baidu['result']['face_list'][0]['quality']['completeness'],'face_img':img64,"pwd":str(pwd),"code":20000}


def getBase64():
    """
        将output/ori.jpg转base64添加至base64.txt末尾
    """
    im = cv2.imread(f"output/ori.jpg")
    img_encode = cv2.imencode(".jpg", im)[1]
    data_encode = np.array(img_encode)
    img_b64 = data_encode.tobytes()
    img64 = base64.b64encode(img_b64).decode("utf-8")
    with open("output/base64.txt","a") as f:
        f.write("data:image/jpg;base64," + img64 + "\n" * 3)


